HiveMetaStore.endFunction, lines 887 after your patch, I don't understand the following addition:
{code}
              if (!context.isSuccess() && context.getException() == null) {
888	        throw new MetaException("Commit transaction failed");
889	      }
{code}
Why should this method be throwing if the context says failure?  Shouldn't that be up to the calling methods?  Also, since the context is passed to the end function listener this means a broken end function listener that messed with the context could cause metastore calls to fail.
